let technolgiesArray = [
    {
        id:0,
        name:'HTML',
        imgSrc:'data:image/png;base64,'
    },
    {
        id:1,
        name:'CSS',
        imgSrc:'data:image/png;base64,'
    },
    {
        id:2,
        name:'JAVASCRIPT',
        imgSrc:'data:image/png;base64,'
    },
    {
        id:3,
        name:'ANGULAR',
        imgSrc:'data:image/png;base64,'
    },
    {
        id:4,
        name:'REACT',
        imgSrc:'data:image/png;base64,'
    },
    {
        id:5,
        name:'VUE',
        imgSrc:'data:image/png;base64,'
    },
];

document.addEventListener('DOMContentLoaded',()=>{
    let parent = document?.querySelector(".list-container");
    for(let tech of technolgiesArray){
        let listItem = document?.createElement("li");
        listItem?.classList?.add("list","card");
        listItem?.setAttribute("draggable",true);
        let imageElement = document.createElement("img");
        imageElement.id= tech.id;
        imageElement.src = tech?.imgSrc;
        listItem?.appendChild(imageElement);
        let desc = document?.createElement("div");
        desc.textContent = tech.name;
        listItem.appendChild(desc);
        parent.appendChild(listItem);
    }

    addEventListeners();

})

function addEventListeners(){
    let technologiesDoneList = document?.querySelector(".right");
    let listsElements = document?.querySelectorAll(".list");
    let technologiesList = document?.querySelector(".list-container");
    
    let item =''
    
    technologiesList?.addEventListener('drop',(event)=>{
        technologiesList.appendChild(item);
    });
    
    technologiesList?.addEventListener('dragover',(event)=>{
        event?.preventDefault();
    });
    
    technologiesDoneList?.addEventListener('dragover',(event)=>{
        event?.preventDefault();
    });
    
    technologiesDoneList?.addEventListener('drop',(event)=>{   
        technologiesDoneList.appendChild(item)
    })
    
    Array?.from(listsElements)?.forEach((ele)=>{
       ele?.addEventListener('dragstart',(event)=>{
        item = event?.target
       })   
    })
    
}

